    <>
      <div className="header">
        {props.isAuth ? (
          <div>
            email: {props.email}, login:{props.login}
          </div>
        ) : (
          <NavLink to={"/login"}>login</NavLink>
        )}
      </div>
      <style jsx>
        {`
          .header {
            display: flex;
            justify-content: flex-end;
          }
        `}
      </style>
    </>
  );
};

export default Header;
